            removeFilter = function (type) {
                if (type === undefined) {
                    return;
                }
                filter[type].removeAll();
            },
            arrContains = function (arr, s) {
                var r, i;
                r = false;
                i = arr.length;
                while (i--) {
                    if (arr[i] === s) {
                        r = true;
                        i = 0;
                    }
                }
                return r;
            },
            updateFilterNoDupe = function (add, type, code) {
                if (type === undefined) {
                    return false;
                }
                if (!arrContains(filter[type](), code)) {
                    if (add === true) {
                        filter[type].push(code);
                        return true;
                    }
                } else {
                    if (add !== true) {
                        filter[type](_.without(filter[type](), code));
                    }
                }
                return false;
            },
            updateFilter = function (add, type, code) {
                if (type === undefined) {
                    return;
                }
                if (add === true) {
                    filter[type].push(code);
                } else {
                    filter[type](_.without(filter[type](), code));
                }
            },
            addSeparator = function (number) {
                number += '';
                var x = number.split('.');
                var x1 = x[0];
                var x2 = x.length > 1 ? '.' + x[1] : '';
                var rgx = /(\d+)(\d{3})/;
                while (rgx.test(x1)) {
                    x1 = x1.replace(rgx, '$1' + ' ' + '$2');
                }
                return x1 + x2;
            },

